import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <>
      <div className="Home">
        <div className="title">
          <h1>PORTFOLIO</h1>
        </div>
        <p>
          <Link to="/header">Page 1</Link>
        </p>
      </div>
      ;
    </>
  );
};

export default Home;
